const exchangeLogo=exchangeId=>`<img class="coin-logo" src="https://s2.coinmarketcap.com/static/img/exchanges/64x64/${exchangeId}.png" alt="exchange logo"></img>`;const cc=data=>`\n  <div class="trading-bot-container">\n         \n      <div class="tranding-bot-field trading-bot-buy">\n          <div class="flex items-center" style="margin-right: 1rem;">\n              <img class="coin-logo" src="/images/cryptoicons/SVG/${data.coin.symbol.toLowerCase()}.svg" alt="coin logo">\n              <span>${data.coin.symbol}</span>\n          </div>\n          <div class="flex items-center" style="margin-right: 5px;">\n              ${exchangeLogo(data.min.exchangeId)}\n              <span class="limit">${data.min.exchangeName}</span>\n              <span>$${data.min.price}</span>\n          </div>\n      </div>\n\n      <div class="tranding-bot-field trading-bot-sell">\n          <div class="" style="margin-right: 1rem;">\n               <img class="coin-logo" src="/images/cryptoicons/SVG/${data.coin.symbol.toLowerCase()}.svg" alt="coin logo">\n              <span>${data.coin.symbol}</span>\n          </div>\n          <div class="flex items-center" style="margin-right: 5px;">\n              ${exchangeLogo(data.max.exchangeId)}\n              <span class="limit">${data.max.exchangeName}</span>\n              <span>$${data.max.price}</span>\n          </div>\n      </div>\n  \n      <div class="tranding-bot-field trading-bot-diff">\n        <div style="margin-right: 1rem;">\n            <span>$${data.diff}</span>\n        </div>\n        <div>\n            <span>${data.diffPerc}%</span>\n        </div>\n      </div>\n    \n  \n  </div>`;const createElement=elementString=>{const template=document.createElement("div");template.innerHTML=elementString.trim();return template.firstElementChild};document.addEventListener("DOMContentLoaded",(event=>{const diffContainer=document.querySelector("#exchange-diffs");if(!diffContainer)return;addSseListener("bot-action",(function(e){const dec=JSON.parse(e.data);diffContainer.innerHTML="";const element=createElement(cc(dec));element.style.display="hidden";diffContainer.append(element);element.style.display="flex"}))}));